import dynamic from 'next/dynamic'
import Layout from '../components/Layout';

const DynamicComponent = dynamic(() => import('../components/Map'))

function Home() {
  return (


        <Layout>
          <div>
            <h1>Empatica</h1>
            <p>downlad apps</p>
            <DynamicComponent />
          </div>
        </Layout>
  )
}

export default Home
